INSERT INTO `page` VALUES (2,1,0,0,2,0,'O Firmie','<div class=\"container\">\r\n<div class=\"row\">\r\n<div class=\"col-sm-12\">\r\n<div class=\"headline\">\r\n<h3>Kilka słów o MAXKOD</h3>\r\n</div>\r\n<!-- headline --></div>\r\n<!-- col --></div>\r\n<!-- row --></div>\r\n<!-- container -->\r\n\r\n<div class=\"container\">\r\n<div class=\"row\">\r\n<div class=\"col-md-5 col-sm-12\">\r\n<h4>Zespół MAXKOD lubi swoją pracę, nie boi się wyzwań i stale się rozwija</h4>\r\n&nbsp;\r\n\r\n<p>Jesteśmy zespołem projektującym z pasją nowoczesne strony, sklepy i aplikacje internetowe oraz aplikacje pod Windows. Stawiamy na nowoczesność, funkcjonalność i bezpieczeństwo. Ponad 11-letnie doświadczenie w tworzeniu stron oraz zaawansowanych projektów internetowych sprawia, że nie obawiamy się nowych wyzwań. Zaufało nam szerokie grono klientów, możesz zaufać i Ty.</p>\r\n</div>\r\n<!-- col -->\r\n\r\n<div class=\"col-md-3 col-sm-6\">\r\n<ul class=\"check-list blue\">\r\n	<li>Uczciwość</li>\r\n	<li>Wielu Zadowolonych Klientów</li>\r\n	<li>11 letnie doświadczenie w branży IT</li>\r\n	<li>Skuteczne Pozycjonowanie</li>\r\n	<li>Bezpieczny Kod</li>\r\n	<li>Najlepsze Serwery</li>\r\n	<li>Gwarancja&nbsp;</li>\r\n	<li>MOŻESZ ZAUFAĆ !!!</li>\r\n</ul>\r\n</div>\r\n<!-- col -->\r\n\r\n<div class=\"col-md-4 col-sm-6\">\r\n<p><img alt=\"\" src=\"/filemanager/files/grafika/monitor-maxkod-ofirmie.png\" /></p>\r\n</div>\r\n<!-- col --></div>\r\n<!-- row --></div>\r\n<!-- container -->\r\n\r\n<section class=\"full-section dark-section parallax\" data-stellar-background-ratio=\"0.1\" id=\"section-11\">\r\n<div class=\"full-section-overlay-color\">&nbsp;</div>\r\n\r\n<div class=\"full-section-container\">\r\n<div class=\"container\">\r\n<div class=\"row\">\r\n<div class=\"col-sm-12\">\r\n<h3 class=\"text-center\"><strong>MAXKOD.PL <span class=\"text-default\">w</span> <span class=\"text-default\">liczbach</span></strong></h3>\r\n</div>\r\n<!-- col --></div>\r\n<!-- row --></div>\r\n<!-- container --><br />\r\n<br />\r\n&nbsp;\r\n<div class=\"container\">\r\n<div class=\"row\">\r\n<div class=\"col-sm-3\">\r\n<div class=\"counter default\"><i class=\"mt-icon-myspace\"></i>\r\n<div class=\"counter-value\" data-value=\"180\">&nbsp;</div>\r\n\r\n<div class=\"counter-details\">Klientów</div>\r\n</div>\r\n<!-- counter --></div>\r\n<!-- col -->\r\n\r\n<div class=\"col-sm-3\">\r\n<div class=\"counter default\"><i class=\"mt-icon-document3\"></i>\r\n<div class=\"counter-value\" data-value=\"310\">&nbsp;</div>\r\n\r\n<div class=\"counter-details\">Porojektów</div>\r\n</div>\r\n<!-- counter --></div>\r\n<!-- col -->\r\n\r\n<div class=\"col-sm-3\">\r\n<div class=\"counter default\"><i class=\"mt-icon-chart\"></i>\r\n<div class=\"counter-value\" data-value=\"170\">&nbsp;</div>\r\n\r\n<div class=\"counter-details\">pozycjonowanych fraz</div>\r\n</div>\r\n<!-- counter --></div>\r\n\r\n<div class=\"col-sm-3\">\r\n<div class=\"counter default\"><i class=\"glyphicon glyphicon-time\"></i>\r\n<div class=\"counter-value\" data-value=\"11\">&nbsp;</div>\r\n\r\n<div class=\"counter-details\">lat w branży</div>\r\n</div>\r\n<!-- counter --></div>\r\n<!-- col --><!-- col --></div>\r\n<!-- row --></div>\r\n<!-- container --><!--div class=\"container\">\r\n<div class=\"row\">\r\n<div class=\"col-sm-12 text-center\"><a class=\"btn btn-default\" href=\"portfolio-classic.html\">See our portfolio</a></div>\r\n<!-- col ></div>\r\n<!-- row ></div--><!-- container --></div>\r\n<!-- full-sections-container --></section>\r\n<!-- full-sections -->','2015-04-0213.49.14.jpg',0.00,'','O firmie informacje','','','o-firmie','fullView.html','2016-12-27 08:42:00',1000,0,1),(3,1,0,0,2,0,'Polityka Prywatności','<div class=\"container\">\r\n<h2>Dane zbierane automatycznie</h2>\r\n\r\n<p>Podczas Twojej wizyty na naszej stronie internetowej, automatycznie zbierane są dane dotyczące Twojej wizyty, np. Twój adres IP, nazwa domeny, typ przeglądarki, typ systemu operacyjnego, itp.</p>\r\n\r\n<h2>Dane zbierane, gdy kontaktujesz się z nami</h2>\r\n\r\n<p>Gdy kontaktujesz się z nami za pomocą strony internetowej, telefonu, poczty email, itp. przekazujesz nam swoje dane osobowe, np. imię, nazwisko, adres email, itp.</p>\r\n\r\n<h2>W jaki sposób wykorzystujemy Twoje dane?</h2>\r\n\r\n<p>W żadnym wypadku nie będziemy sprzedawali danych zebranych o Tobie podmiotom trzecim.</p>\r\n\r\n<p>Dane zbierane podczas rejestracji będą wykorzystane wyłącznie do umożliwienia Tobie zalogowania się do naszego systemu.</p>\r\n\r\n<p>Jeżeli zapisałeś się na nasz Newsletter, lub w inny sposób wyraziłeś zgodę na jego otrzymywanie, wykorzystamy Twoje dane w celu wysłania Ci naszego Newslettera. Zostaniesz zapytany czy chcesz otrzymywać Newsletter podczas rejestracji.</p>\r\n\r\n<p>Dane zbierane automatycznie mogą być użyte do analizy zachowań użytkowników na naszej stronie internetowej, zbierania danych demograficznych o naszych użytkownikach, lub do personalizacji zawartości naszych stron internetowych. Dane te są zbierane automatycznie o każdym użytkowniku. Dane zbierane w trakcie korespondencji pomiędzy Tobą, a naszym serwisem będą wykorzystane wyłącznie w celu odpowiedzi na Twoje zapytanie.</p>\r\n\r\n<p>W przypadku kontroli Generalnego Inspektoratu Ochrony Danych Osobowych, Twoje dane mogą zostać udostępnione pracownikom Inspektoratu zgodnie z ustawą o ochronie danych osobowych.</p>\r\n\r\n<p>W przypadku naruszenia Regulaminu naszego serwisu, naruszenia prawa, lub gdy będą wymagały tego przepisy prawa, możemy udostępnić Twoje dane organom wymiaru sprawiedliwości.</p>\r\n\r\n<h2>Google Analytics</h2>\r\n\r\n<p>Niniejsza witryna internetowa korzysta z Google Analytics, usługi analizy oglądalności stron internetowych udostępnianej przez Google, Inc. (“Google”). Google Analytics używa “cookies”, czyli plików tekstowych umieszczanych na komputerze użytkownika w celu umożliwienia witrynie przeanalizowania sposobu, w jaki użytkownicy z niej korzystają. Informacje generowane przez cookie na temat korzystania z witryny przez użytkownika (włącznie z jego adresem IP) będą przekazywane spółce Google i przechowywane przez nią na serwerach w Stanach Zjednoczonych.</p>\r\n\r\n<p>Google będzie korzystała z tych informacji w celu oceny korzystania z witryny przez użytkownika, tworzenia raportów dotyczących ruchu na stronach dla operatorów witryn oraz świadczenia innych usług związanych z ruchem na witrynach internetowych i korzystaniem z internetu. Google może również przekazywać te informacje osobom trzecim, jeżeli będzie zobowiązana to uczynić na podstawie przepisów prawa lub w przypadku, gdy osoby te przetwarzają takie informacje w imieniu Google. Google nie będzie łączyła adresu IP użytkownika z żadnymi innymi danymi będącymi w jej posiadaniu. Użytkownik może zrezygnować z cookies wybierając odpowiednie ustawienia na przeglądarce, jednak należy pamiętać, że w takim przypadku korzystanie z wszystkich funkcji witryny może okazać się niemożliwe Korzystając z niniejszej witryny internetowej użytkownik wyraża zgodę na przetwarzanie przez Google dotyczących go danych w sposób i w celach określonych powyżej.</p>\r\n\r\n<p>Użytkownik który nie wyraża zgody na działanie systemu Google Analytics powinien zastosować blokadę plików cookies.</p>\r\n\r\n<h2>W jaki sposób będziemy się z Tobą kontaktować?</h2>\r\n\r\n<p>Jeżeli zapisałeś się na nasz Newsletter, lub w inny sposób wyraziłeś zgodę na jego otrzymywanie, będziesz od nas otrzymywać drogą emailową nasz Newsletter.</p>\r\n\r\n<h2>Wykorzystanie ciasteczek (\"cookies\")</h2>\r\n\r\n<p>Nasza strona internetowa wykorzystuje ciasteczka, które służą identyfikacji Twojej przeglądarki podczas korzystania z naszej strony, abyśmy wiedzieli jaką stronę Ci wyświetlić. Ciasteczka nie zawierają żadnych danych osobowych.</p>\r\nPliki cookies wykorzystywane są w celu:\r\n\r\n<ul>\r\n	<li>dostosowania zawartości strony internetowej do indywidualnych potrzeb użytkownikach</li>\r\n	<li>tworzenia statystyk w celu badania funkcjonalności poszczególnych stron serwisu</li>\r\n	<li>utrzymywanie sesji użytkownika serwisu (po zalogowaniu) dzięki czemu użytkownik przy każdym przeładowaniu strony nie musi ponownie wpisywać loginu i hasła</li>\r\n	<li>dostarczania użytkownikom serwisu treści reklamowych bardziej dostosowanych do ich zainteresowań</li>\r\n</ul>\r\n\r\n<p>Pliki cookies nie powodują zmian konfiguracyjnych w urządzeniu lub oprogramowaniu zainstalowanym w urządzeniu Użytkownika.</p>\r\n\r\n<p>Użytkownik, który chce usunąć dotychczasowe pliki cookies powinien wybrać odpowiednie ustawienia w swojej przeglądarce internetowej lub usunąć pliki cookies ręcznie.</p>\r\n\r\n<h2>Zmiany naszej polityki prywatności.</h2>\r\n\r\n<p>Zastrzegamy sobie prawo zmiany powyższej polityki prywatności poprzez opublikowanie nowej polityki prywatności na tej stronie.</p>\r\n\r\n<h2>Kontakt</h2>\r\n\r\n<p>Dane zbiera firma: INTERIUM Strony i Aplikacje Internetowe Joanna Szelągowska, ul. Kościuszki 51/15 59-700 Bolesławiec, NIP: 612-167-48-70</p>\r\n\r\n<p>W razie dodatkowych pytań dotyczących ochrony prywatności, prosimy o kontakt korzystając z formularza kontaktowego na stronie kontaktowej.</p>\r\n</div>\r\n','2016-12-224.png',0.00,'','','','','polityka-prywatnosci','fullView.html','2016-12-28 13:01:10',0,0,1),(4,1,0,0,2,0,'Rafał Żygadło','<div class=\"container\">\r\n<h1>O MNIE</h1>\r\n\r\n<p>Nazywam się <strong>Rafał Żygadło</strong> urodzony w Bolesławcu.<br />\r\nJestem od trzech lat weganinem. Dzięki tej diecie mam więcej energii i dlatego od kilku lat też biegam.</p>\r\n\r\n<p><br />\r\nFirma <strong>Maxkod</strong> to po części mój pomysł. Firma powstała aby zrealizować wreszcie swoje wizje w świecie programowania i pomóc firmom&nbsp;w naszej okolicy zrealizować .. ?</p>\r\n\r\n<p>Ale najważniejszym&nbsp;</p>\r\n\r\n<h1>MUZYKA</h1>\r\n\r\n<p>Kocham muzykę, kto wie czy to nie jest większa moja pasja niż programowanie. Ale nie udało mi się jeszcze nic nagrać. Słucham za to bardzo dużo, od ponad 30 lat, jeszcze nagrywałem z radia piosenki na kasety Stilon Gorzów. W 1992 roku rodzice kupili mi pierwszy odtwarzacz CD i od tamtego czasu słucham płyt. Bardzo lubię polskie zespoły. Jednym z moich ulubionych i jedynym w swoim rodzaju jest zespół COMA.</p>\r\n\r\n<h1>ROWER</h1>\r\n\r\n<h1>BIEGANIE</h1>\r\n\r\n<p>Biegać zacząłem bo rower był dla mnie za słabym \'męczycielem\'. Nie wiem ile kilometrów dotąd przebiegłem, ale nie udało mi się przebiec maratonu. Najdłuższy dystans który udało mi się przebiec to 22 km w 2 godziny.</p>\r\n\r\n<h1>WARTOŚCI</h1>\r\n\r\n<p>Najważniejsza dla mnie w życiu jest szczerość, tolerancja, pokój, wolność.</p>\r\n</div>\r\n','2012-09-1710.50.57_2.jpg',0.00,'','','','','rafal-zygadlo','fullView.html','2017-01-07 14:54:27',0,0,1),(102,1,0,0,2,0,'Produkty','','yellow-min.jpg',0.00,'','','','','produkty','listnewsView.html','2017-03-27 13:53:18',0,0,1),(103,1,0,102,2,0,'p1','<p>Produkt numer 1</p>\r\n','2012-05-1223.24.17.jpg',0.00,'','','','','produkty-p1','fullView.html','2017-03-27 13:53:47',0,0,1),(105,1,0,0,2,0,'Galeria','','violator_1920_11_1.jpg',0.00,'','','','','galeria','galleryView.html','2017-04-03 11:27:33',0,0,1),(106,1,0,105,2,0,'','',NULL,0.00,'','','','','galeria-','fullView.html','2017-04-26 18:02:42',0,0,1),(109,1,0,0,1,0,'Galeria - Kopiuj','','violator_1920_11_1.jpg',0.00,'','','','','galeria','galleryView.html','2017-04-26 18:22:45',0,0,1),(110,1,0,102,2,0,'p2','<p>Produkt numer 2</p>\r\n','2012-08-1215.29.41.jpg',0.00,'','','','','produkty-','fullView.html','2017-04-26 18:32:38',0,0,1),(111,1,0,102,2,0,'p3','<p>Produkt numer 3</p>\r\n','2012-08-2521.52.48.jpg',0.00,'','','','','produkty-','fullView.html','2017-04-26 18:33:15',0,0,1),(112,1,0,102,2,0,'p4','',NULL,0.00,'','','','','produkty-p4','fullView.html','2017-05-15 13:12:08',0,0,1),(113,1,0,102,2,0,'p5','',NULL,0.00,'','','','','produkty-p5','fullView.html','2017-05-15 13:12:21',0,0,1),(114,1,0,102,2,0,'p6','',NULL,0.00,'','','','','produkty-p6','fullView.html','2017-05-15 13:13:12',0,0,1);
